const products = [
  { name: "Red Shirt", brand: "StyleHub", price: "$25", image: "https://johnellies.in/cdn/shop/files/586MS_PRed.jpg?v=1708335491"},
  { name: "Blue Jeans", brand: "UrbanFit", price: "$45", image: "https://xcdn.next.co.uk/common/items/default/default/itemimages/3_4Ratio/product/lge/218472s.jpg?im=Resize,width=750" },
  { name: "White Sneakers", brand: "SneakPeak", price: "$60", image: "data:image/jpeg;base64," },
  { name: "Smartphones", brand: "Vivo", price: "$150", image: "data:image/jpeg;base64," },
  { name: "Laptop", brand: "Apple", price: "$800", image: "D:\laptop.jfif" },
  { name: "Leather Handbag", brand: "LuxStyle", price: "$120", image: "data:image/jpeg;base64," },
  { name: "Sports Watch", brand: "TimeX", price: "$90", image: "data:image/jpeg;base64," },
  { name: "Headphones", brand: "UrbanFit", price: "$35", image: "data:image/jpeg;base64," }
];

function loadProducts() {
  const container = document.getElementById('product-list');
  container.innerHTML = "";
  products.forEach(p => {
    container.innerHTML += `
      <div class="product-card">
        <img src="${p.image}" class="product-thumb" alt="${p.name}">
        <div class="product-info">
          <h4>${p.brand}</h4>
          <p>${p.name}</p>
          <p class="price">${p.price}</p>
        </div>
        <button>Add to Cart</button>
      </div>
    `;
  });
}

window.onload = loadProducts;
